import React from "react";
import {
  Button,
  CardContent,
  Grid,
  Table,
  TextField,
  Card,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import { useLocation } from "react-router-dom";
import { useSelector } from "react-redux";
import BorderColorIcon from "@mui/icons-material/BorderColor";
import DeleteIcon from "@mui/icons-material/Delete";

export const Categorylist = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const handleBack = () => {
    navigate("/cat");
  };

  const { name } = location.state || {};

  const mydata = useSelector((state) => state.senddataReducer.alldata);

  return (
    <Card sx={{ background: "lightblue" }}>
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={2}>
            <h3>Category List</h3>
          </Grid>
          <Grid item xs={8}></Grid>
          <Grid item xs={2}>
            <Button
              onClick={handleBack}
              variant="contained"
              fullWidth
              color="success"
            >
              Add Category{" "}
            </Button>
          </Grid>
          <Grid item xs={12}>
            <Grid container spacing={2}>
              <Grid item xs={7}></Grid>
              <Grid item xs={1}>
                <p>Search:</p>
              </Grid>
              <Grid item xs={3}>
                <TextField variant="outlined" fullWidth />
              </Grid>
            </Grid>
          </Grid>

          {/* <Grid item xs={12}> */}
          <Grid container spacing={2}>
            <Grid item xs={12}>
              {mydata.map((item) => (
                <Table>
                  <tr>
                    <td>1</td>
                    <td>{item.name}</td>
                    <td>Active</td>
                    <Grid container spacing={1}>
                      <Grid item xs={6}>
                        <BorderColorIcon style={{ color: "green" }} />
                      </Grid>
                      <Grid item xs={1}>
                        <DeleteIcon style={{ color: "red" }} />
                      </Grid>
                    </Grid>
                  </tr>
                </Table>
              ))}
            </Grid>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};
